const Home = (props) => {
    function dothis(e){
        alert('Hello');
    }
    return (
        <>
            <h1>Name: {props.name}</h1>
            <h1>Age: {props.age}</h1>
            <button onClick={dothis.bind(this,"Hello I am bind...")}>Click Me</button>
        </>
    )
}
export default Home;
